import React, { Fragment, useState, useEffect } from 'react';

import Card from './Card';

const CardList = ({products, addToCart}) => {

    return (
                <div>
                    <div className="card-list">
                        {
                            products.map(item => {
                                return (
                                    <Card key={item.id} data={item} addToCart={addToCart} />
                                )
                            })
                        }
                    </div>
                </div>
    )
}

export default CardList
